import React from "react";
import './Login.css'
import 'bootstrap/dist/css/bootstrap.min.css';

const Login = () => {
  const logoBK = require('./../../assets/Image/logoBK.png')
  const google = require('./../../assets/Image/google-icon.png')
  return (
    <div
      className="login_bg"
      style={{
        backgroundImage:
          'url("https://hcmut.edu.vn/img/carouselItem/07531069.jpg?t=07531113")',
      }}
    >
      <div className = "login_form">
        <div className = "box">
        <div className="text-center">
                  <img
                    src={logoBK}
                    alt="logo_BK"
                    className="logo_BK rounded-circle"
                  />
                </div>
          <div className = "content_box">
            <div className = "register">
              Bạn chưa có tài khoản?
              Đăng kí ngay!
            </div>
            <div className = "login_using_google">
              <img src={google} alt='google' className='google' />  
              Đăng nhập bằng Google
            </div>
          </div>
        </div>
      </div>
    </div>
  );
};

export default Login;
